import React from 'react'
import styled from 'styled-components/native';
import Logo from '../components/StaLogo'
import { FontAwesome } from '@expo/vector-icons';

const SafeArea = styled.SafeAreaView`
background: ${props => props.theme.colors.appBackground};
`

const Text = styled.Text`
    color: ${props => props.theme.colors.staBlack};

`


const ProjectList = () => {
    return (
        <SafeArea>
            <Logo />
            <FontAwesome.Button name="facebook" backgroundColor="#3b5998" >
        Login with Facebook
      </FontAwesome.Button>
            <Text>Testing Screen</Text>
        </SafeArea>
    )
}

export default ProjectList
